import React,{Component} from "react";

class Third extends Component{
    constructor(props){
        super(props);
        this.props=props;
        this.state ={
            name:'a',
            value:10
        };
    }
    render(){
        return(
            <div>
                Hello i am this ={this.props.number}
                and state name ={this.state.name}
            </div>
        );
    }
}
export default Third;
